public class Solution {
    public int SumIndicesWithKSetBits(IList<int> nums, int k) {
        int sum = 0;
        for (int i = 0; i < nums.Count; i++) {
            // Count the set bits of the current index
            int setBits = CountSetBits(i);
            // If the count of set bits equals k, add the value at that index to sum
            if (setBits == k) {
                sum += nums[i];
            }
        }
        return sum;
    }

    private int CountSetBits(int number) {
        int count = 0;
        while (number > 0) {
            count += number & 1; // Increment count if the least significant bit is 1
            number >>= 1; // Shift the bits of number to the right by 1
        }
        return count;
    }
}
